import './App.css';
import {Header} from './component/header'
import {TopImage} from './component/top-image'
import {MainPage} from './component/mainpage'
import { Router, Route, Link } from 'react-router'


function App() {
  return (
    <div className="App">
      <Router>
        <Route path="/" component={PageApp} />
        <Route path="/next" component={NextApp} />
      </Router>
    </div>
  );
}

function PageApp () {
  return (
    <div>
      <Header/>
      <TopImage />
      <MainPage />
    </div>
  )
}

function NextApp () {
  return (
    <div>
      <h3>123123123</h3>
    </div>
  )
}

export default App;
